import {
    POST_PRICE_LIST_DATA,
    POST_PRICE_LIST_DATA_SUCCESS
} from "./actionType";

// post api
export const postPriceListData = (Data, id) => ({
    type: POST_PRICE_LIST_DATA,
    Data, id
});

export const postPriceListDataSuccess = (PartySaveSuccess) => ({
    type: POST_PRICE_LIST_DATA_SUCCESS,
    payload: PartySaveSuccess,
});
